INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 118501, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 0, 118501, 0, 0, "カリン", 1, "2021/10/19 12:00:00", "かりん", 0, 787, 37, 118501, 0, 2.0, 37, 450, 1, 118501, 0, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 118601, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 118601, 0, 0, "ネビア", 1, "2024/08/10 21:00:00", "ねびあ", 0, 826, 0, 118601, 0, 2.0, 0, 450, 3, 118601, 0, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 119001, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 119001, 0, 0, "イオ（ノワール）", 0, "2021/11/03 19:00:00", "いお", 0, 714, 7, 119001, 0, 2.27, 7, 450, 3, 119001, 0, 2, "2030/12/31 15:00:00", 15);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 119101, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 119101, 0, 0, "クウカ（ノワール）", 0, "2021/11/16 12:00:00", "くうか", 0, 143, 26, 119101, 0, 2.545, 7, 450, 3, 119101, 0, 2, "2030/12/31 15:00:00", 12);
