INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 120701, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 0, 120701, 0, 0, "シェフィ（ニューイヤー）", 1, "2025/01/15 15:00:00", "しぇふぃ", 0, 283, 22, 120701, 0, 1.84, 4, 450, 3, 120701, 0, 1, "2025/01/20 11:59:59", 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 120801, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 0, 120801, 0, 0, "ルカ（ニューイヤー）", 1, "2023/10/16 15:00:00", "るか", 0, 193, 22, 120801, 0, 1.3, 4, 450, 1, 120801, 0, 1, "2030/12/31 15:00:00", 2);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 120901, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 0, 120901, 0, 0, "イリヤ（ニューイヤー）", 1, "2025/01/15 15:00:00", "いりや", 0, 424, 38, 120901, 0, 1.425, 3, 450, 3, 120901, 0, 2, "2025/01/20 11:59:59", 12);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 0, 121001, 0, 0, "ペコリーヌ（オーバーロード）", 1, "2025/02/20 12:00:00", "ぺこりーぬ", 0, 164, 41, 121001, 0, 2.25, 5, 450, 3, 121001, 0, 1, "2025/02/24 11:59:59", 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 0, 121101, 0, 0, "キャル（オーバーロード）", 1, "2025/02/20 12:00:00", "きゃる", 0, 588, 42, 121101, 0, 2.07, 7, 450, 3, 121101, 0, 2, "2025/02/24 11:59:59", 1);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 0, 121201, 0, 0, "ラビリスタ（オーバーロード）", 1, "2023/11/16 15:00:00", "らびりすた", 0, 260, 40, 121201, 0, 1.55, 4, 450, 1, 121201, 0, 1, "2030/12/31 15:00:00", 6);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 121301, 0, 0, "クルミ（ステージ）", 0, "2022/03/03 19:00:00", "くるみ", 0, 731, 3, 121301, 0, 1.9, 3, 450, 3, 121301, 0, 1, "2030/12/31 15:00:00", 3);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 121401, 0, 0, "ミサキ（ステージ）", 0, "2022/03/15 15:00:00", "みさき", 0, 742, 7, 121401, 0, 2.27, 7, 450, 3, 121401, 0, 2, "2030/12/31 15:00:00", 15);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 0, 121501, 0, 0, "アユミ（怪盗）", 1, "2025/04/26 12:00:00", "あゆみ", 0, 590, 6, 121501, 0, 2.0, 6, 450, 3, 121501, 0, 1, "2025/04/30 11:59:59", 12);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 121601, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 121601, 0, 0, "イノリ（怪盗）", 0, "2022/04/15 15:00:00", "いのり", 0, 292, 3, 121601, 0, 1.425, 3, 450, 3, 121601, 0, 1, "2030/12/31 15:00:00", 17);
