INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128301, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 0, 128301, 0, 0, "イノリ（ニューイヤー）", 1, "2023/12/31 12:00:00", "いのり", 0, 191, 38, 128301, 0, 2.09, 3, 450, 1, 128301, 1, 1, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128401, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 0, 128401, 0, 0, "ハツネ（ニューイヤー）", 1, "2025/01/09 12:00:00", "はつね", 0, 801, 21, 128401, 0, 2.09, 7, 450, 3, 128401, 0, 2, "2025/01/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128501, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 0, 128501, 0, 0, "カスミ（ニューイヤー）", 1, "2025/01/09 12:00:00", "かすみ", 0, 739, 21, 128501, 0, 2.09, 7, 450, 3, 128501, 0, 2, "2025/01/15 14:59:59", 0);
