INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128701, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 0, 128701, 0, 0, "ヒヨリ（アストラル）", 1, "2025/02/10 12:00:00", "ひより", 0, 226, 0, 128701, 0, 2.09, 1, 450, 3, 128701, 0, 1, "2025/02/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128801, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 0, 128801, 0, 0, "レイ（アストラル）", 1, "2025/08/16 15:00:00", "れい", 0, 194, 0, 128801, 0, 1.965, 4, 450, 1, 128801, 0, 1, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 128901, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 0, 128901, 0, 0, "ユイ（アストラル）", 1, "2025/02/10 12:00:00", "ゆい", 0, 772, 0, 128901, 0, 2.09, 7, 450, 3, 128901, 0, 2, "2025/02/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129001, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 0, 129001, 0, 0, "エリス", 1, "2025/08/31 12:00:00", "えりす", 0, 800, 0, 129001, 0, 2.09, 7, 450, 3, 129001, 0, 2, "2025/09/16 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129301, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 0, 129301, 0, 0, "ユニ（ウィンター）", 1, "2025/03/10 12:00:00", "ゆに", 0, 708, 7, 129301, 0, 2.09, 7, 450, 3, 129301, 0, 1, "2025/03/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129401, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, 129401, 0, 0, "クロエ（ウィンター）", 0, "2024/03/18 12:00:00", "くろえ", 0, 188, 2, 129401, 0, 2.09, 2, 450, 3, 129401, 0, 1, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129501, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 0, 129501, 0, 0, "チエル（ウィンター）", 1, "2025/06/20 12:00:00", "ちえる", 0, 247, 1, 129501, 0, 2.09, 1, 450, 3, 129501, 0, 1, "2025/06/27 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129601, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 0, 129601, 0, 0, "アネモネ", 1, "2025/08/31 12:00:00", "あねもね", 0, 550, 0, 129601, 0, 2.09, 0, 450, 3, 129601, 0, 1, "2025/09/16 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129701, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 0, 129701, 0, 0, "ネフィ＝ネラ", 1, "2025/08/31 12:00:00", "ねふぃーねら", 0, 540, 0, 129701, 0, 2.09, 0, 450, 3, 129701, 0, 1, "2025/09/16 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129801, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 0, 129801, 0, 0, "マコト（コマンダー）", 1, "2025/04/26 12:00:00", "まこと", 0, 269, 5, 129801, 0, 2.09, 5, 450, 3, 129801, 0, 1, "2025/04/30 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 129901, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, 129901, 0, 0, "エリコ（コマンダー）", 0, "2024/04/15 15:00:00", "えりこ", 0, 294, 48, 129901, 0, 1.84, 6, 450, 3, 129901, 0, 1, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 130001, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 0, 130001, 0, 0, "ヤマト", 1, "2025/05/03 19:00:00", "やまと", 0, 150, 0, 130001, 0, 2.09, 4, 450, 3, 130001, 0, 1, "2025/05/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 130101, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 0, 130101, 0, 0, "ワカナ", 1, "2025/05/03 19:00:00", "わかな", 0, 535, 9, 130101, 0, 2.09, 7, 450, 3, 130101, 0, 1, "2025/05/15 14:59:59", 0);
