INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 130701, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 0, 130701, 0, 0, "キョウカ（スプリング）", 1, "2025/05/03 19:00:00", "きょうか", 0, 563, 7, 130701, 0, 1.92, 7, 450, 3, 130701, 0, 2, "2025/05/15 14:59:59", 0);
