INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131001, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 0, 131001, 0, 0, "マホ（ドリームパーク）", 1, "2025/06/10 12:00:00", "まほ", 0, 702, 7, 131001, 0, 1.84, 7, 450, 3, 131001, 0, 2, "2025/06/20 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131101, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, 131101, 0, 0, "ネア（サマー）", 0, "2024/06/30 12:00:00", "ねあ", 0, 165, 52, 131101, 0, 2.09, 2, 450, 3, 131101, 0, 1, "2030/12/31 15:00:00", 0);
