INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131601, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 0, 131601, 0, 0, "リリ（サマー）", 1, "2025/07/10 12:00:00", "りり", 0, 399, 4, 131601, 0, 1.92, 4, 450, 3, 131601, 0, 1, "2025/07/23 11:59:59", 0);
