INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131801, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 0, 131801, 0, 0, "ホマレ（サマー）", 0, "2024/08/15 15:00:00", "ほまれ", 0, 709, 21, 131801, 0, 2.09, 7, 450, 3, 131801, 0, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 131901, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 0, 131901, 1, 0, "エミリア（サマー）", 1, "2024/08/31 12:00:00", "えみりあ", 0, 725, 23, 131901, 0, 2.09, 7, 450, 1, 131901, 1, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132001, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 0, 132001, 1, 0, "エキドナ（サマー）", 1, "2024/09/13 12:00:00", "えきどな", 0, 775, 21, 132001, 0, 2.09, 7, 450, 3, 132001, 0, 2, "2024/09/25 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132101, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 0, 132101, 1, 0, "レム（サマー）", 1, "2024/08/31 12:00:00", "れむ", 0, 146, 24, 132101, 0, 2.09, 13, 450, 3, 132101, 0, 1, "2024/09/13 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132201, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 0, 132201, 0, 0, "ノゾミ（アルケミスト）", 1, "2025/05/03 19:00:00", "のぞみ", 0, 721, 7, 132201, 0, 1.84, 7, 450, 3, 132201, 0, 2, "2025/05/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132301, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 0, 132301, 0, 0, "ルイズマリー", 1, "2025/05/03 19:00:00", "るいずまりー", 0, 754, 7, 132301, 0, 2.09, 7, 450, 3, 132301, 0, 2, "2025/05/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132401, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 0, 132401, 0, 0, "イロハ", 0, "2025/06/20 12:00:00", "いろは", 0, 501, 0, 132401, 0, 2.09, 5, 450, 3, 132401, 0, 1, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132501, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 0, 132501, 0, 0, "ソノ", 0, "2025/05/15 15:00:00", "その", 0, 636, 23, 132501, 0, 2.09, 7, 450, 3, 132501, 0, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132801, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 0, 132801, 0, 0, "ライラエル（クリスマス）", 1, "2025/06/10 12:00:00", "らいらえる", 0, 750, 0, 132801, 0, 2.09, 7, 450, 3, 132801, 0, 2, "2025/06/20 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 132901, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 0, 132901, 0, 0, "イオ（クリスマス）", 0, "2024/12/09 12:00:00", "いお", 0, 748, 46, 132901, 0, 2.09, 5, 450, 3, 132901, 0, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133001, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 133001, 0, 0, "グレイス", 1, "2025/08/31 12:00:00", "ぐれいす", 0, 234, 0, 133001, 0, 2.09, 0, 450, 3, 133001, 0, 1, "2025/09/16 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133101, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 0, 133101, 0, 0, "ヴァイオレット", 1, "2025/08/31 12:00:00", "うぁいおれっと", 0, 154, 0, 133101, 0, 1.75, 0, 450, 3, 133101, 0, 1, "2025/09/16 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133201, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 0, 133201, 0, 0, "モニカ（ニューイヤー）", 1, "2024/12/31 12:00:00", "もにか", 0, 296, 22, 133201, 0, 2.09, 4, 450, 1, 133201, 1, 1, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133501, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 0, 133501, 0, 0, "サレン（ニューイヤー）", 1, "2025/07/10 12:00:00", "されん", 0, 718, 22, 133501, 0, 2.09, 4, 450, 3, 133501, 0, 2, "2025/07/23 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133601, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, 133601, 0, 0, "メドゥーサ", 1, "2025/07/23 12:00:00", "めどぅーさ", 0, 445, 0, 133601, 0, 2.09, 0, 450, 3, 133601, 0, 1, "2025/07/31 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133701, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 0, 133701, 0, 0, "ラビリスタ（アルファ）", 1, "2025/08/15 15:00:00", "らびりすた", 0, 717, 0, 133701, 0, 2.09, 8, 450, 3, 133701, 0, 2, "2025/08/22 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133801, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 0, 133801, 0, 0, "ネネカ（アルファ）", 1, "2025/08/15 15:00:00", "ねねか", 0, 759, 0, 133801, 0, 2.09, 7, 450, 3, 133801, 0, 2, "2025/08/22 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 133901, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 0, 133901, 0, 0, "クリスティーナ（アルファ）", 1, "2025/08/15 15:00:00", "くりすてぃーな", 0, 228, 0, 133901, 0, 2.09, 6, 450, 3, 133901, 0, 1, "2025/08/22 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134001, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 0, 134001, 0, 0, "フィオ", 1, "2025/08/31 12:00:00", "ふぃお", 0, 746, 0, 134001, 0, 2.09, 0, 450, 3, 134001, 0, 2, "2025/09/16 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134101, "", 0, 0, 0, 0, "フブキ", 1, "2015/04/01 15:00:00", "ふぶき", 0, 0, 1, 134101, 0, 0.0, 5, 0, 3, 0, 0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134201, "", 0, 0, 0, 0, "ライラエル（クリスマス）", 1, "2015/04/01 15:00:00", "らいらえる", 0, 0, 1, 134201, 0, 0.0, 7, 0, 3, 0, 0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134301, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 0, 134301, 0, 0, "ランファ（儀装束）", 1, "2025/03/03 19:00:00", "らんふぁ", 0, 778, 0, 134301, 0, 2.09, 7, 450, 3, 134301, 0, 2, "2025/03/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134401, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 0, 134401, 0, 0, "チカ（儀装束）", 0, "2025/03/15 15:00:00", "ちか", 0, 773, 21, 134401, 0, 2.09, 7, 450, 3, 134401, 0, 2, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134501, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 0, 134501, 0, 0, "クローチェ（エアリアル）", 1, "2025/04/08 12:00:00", "くろーちぇ", 0, 719, 0, 134501, 0, 2.09, 0, 450, 3, 134501, 0, 2, "2025/04/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134601, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 0, 134601, 0, 0, "アオイ（パイロット）", 1, "2025/03/31 12:00:00", "あおい", 0, 526, 35, 134601, 0, 2.09, 35, 450, 3, 134601, 0, 1, "2025/04/08 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134701, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 0, 134701, 0, 0, "ホウオウ", 1, "2025/04/15 15:00:00", "ほうおう", 0, 490, 7, 134701, 0, 2.09, 7, 450, 3, 134701, 0, 1, "2025/04/26 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134801, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 0, 134801, 0, 0, "ツムギ（ジオ・ゲヘナ）", 1, "2025/05/31 12:00:00", "つむぎ", 0, 485, 1, 134801, 0, 1.84, 1, 450, 3, 134801, 0, 1, "2025/06/10 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 134901, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 0, 134901, 0, 0, "カノン", 1, "2025/06/10 12:00:00", "かのん", 0, 196, 0, 134901, 0, 2.09, 2, 450, 3, 134901, 0, 1, "2025/06/20 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135001, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 0, 135001, 0, 0, "エリス（サマー）", 1, "2025/06/30 12:00:00", "えりす", 0, 785, 21, 135001, 0, 2.09, 7, 450, 3, 135001, 0, 2, "2025/07/10 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135101, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 0, 135101, 0, 0, "シェフィ（サマー）", 1, "2025/07/10 12:00:00", "しぇふぃ", 0, 143, 4, 135101, 0, 2.09, 4, 450, 3, 135101, 0, 1, "2025/07/23 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135201, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 0, 135201, 0, 0, "プレシア（サマー）", 1, "2025/07/23 12:00:00", "ぷれしあ", 0, 548, 7, 135201, 0, 2.09, 7, 450, 3, 135201, 0, 2, "2025/07/31 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135301, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 0, 135301, 0, 0, "クリア（サマー）", 1, "2025/07/31 12:00:00", "くりあ", 0, 413, 54, 135301, 0, 2.09, 54, 450, 3, 135301, 0, 1, "2025/08/10 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135401, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 0, 135401, 0, 0, "アネモネ（サマー）", 1, "2025/08/10 12:00:00", "あねもね", 0, 553, 52, 135401, 0, 2.09, 2, 450, 3, 135401, 0, 2, "2025/08/15 14:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135501, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 0, 135501, 0, 0, "アイラ", 1, "2025/08/31 12:00:00", "あいら", 0, 213, 0, 135501, 0, 2.09, 1, 450, 3, 135501, 0, 1, "2025/09/08 11:59:59", 0);
INSERT INTO `v1_a498742d01467ee7ba5a37016072c815cbc6a6b49a859008a1b23d049cced423` VALUES (0, 135801, "", 0, 0, 0, 0, "ユキノ", 0, "2015/04/01 15:00:00", "ゆきの", 0, 0, 1, 135801, 0, 0.0, 1, 0, 3, 0, 0, 0, "2030/12/31 15:00:00", 0);
